import ExpenseItem from './components/ExpenseItem';

function App() {

  const expenses =[ // sara khel ese ka hai yeh hi niche access hoga dynamicaly expenseitem component mae
    {
      id:'e1',
      title:'Toilet Paper',
      amount:94.12,
      date : new Date(2020,7,14)
    },


    {
      id:'e2',
      title:'Car Insurance',
      amount:1234.45,
      date : new Date(2020,12,15)
    },


    {
      id:'e3',
      title:'Books',
      amount:123.45,
      date : new Date(2020,9,18)
    }
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      < ExpenseItem name={expenses[0].title} amount = {expenses[0].amount} date={expenses[0].date }></ExpenseItem>{/* we use another components in another file like this first letter is capital letter if we want to use this.    */}
      < ExpenseItem name={expenses[1].title} amount = {expenses[1].amount} date={expenses[1].date }></ExpenseItem>
      < ExpenseItem name={expenses[2].title} amount = {expenses[2].amount} date={expenses[2].date }></ExpenseItem>
       {/* by doing this with the help of props we can send data to ExpenseItem.js through attributes. */}
    </div>
    //  feature by which we can injected html in javascript is called the JSX.
  );
}

export default App;
